require 'pry-byebug'

def length_of_longest_substring(s)
  start = curr = max_length = 0
  store = {}
  s.chars.each_with_index do |char, index|
    start = store[char] + 1 if (start...index).include?(store[char])
    store[char] = index
    curr = index - start + 1
    max_length = curr if curr > max_length
  end
  max_length || 0
end

p length_of_longest_substring('pwwkew')
p length_of_longest_substring('')
